import { combineReducers } from "redux";
import postReducer from "../reducers/reducers";
import usersReducer from "../reducers/rootReducers";
import delReducers from "./delReducers";

export default combineReducers({
  posts: postReducer,
  users: usersReducer,
  delete: delReducers,
});
